VALUES
	(24,'Fedora Object XML','1.1','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<xsd:schema targetNamespace=\"info:fedora/fedora-system:def/foxml#\" xmlns=\"info:fedora/fedora-system:def/foxml#\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\" elementFormDefault=\"qualified\" attributeFormDefault=\"unqualified\">\n	<!-- the root element for FOXML: digitalObject -->\n	<xsd:element name=\"digitalObject\">\n		<xsd:annotation>\n			<xsd:documentation/>\n		</xsd:annotation>\n		<xsd:complexType>\n			<xsd:complexContent>\n				<xsd:extension base=\"digitalObjectType\"/>\n\n			</xsd:complexContent>\n		</xsd:complexType>\n	</xsd:element>\n	<!-- complex type declarations -->\n	<xsd:complexType name=\"digitalObjectType\">\n		<xsd:sequence>\n			<xsd:element name=\"objectProperties\" type=\"objectPropertiesType\"/>\n			<xsd:element name=\"datastream\" type=\"datastreamType\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\n			<xsd:element name=\"disseminator\" type=\"disseminatorType\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\n\n		</xsd:sequence>\n		<xsd:attribute name=\"PID\" type=\"pidType\" use=\"optional\"/>\n		<xsd:attribute name=\"FEDORA_URI\" type=\"xsd:anyURI\" use=\"optional\"/>\n		<xsd:anyAttribute namespace=\"##other\" processContents=\"lax\"/>\n	</xsd:complexType>\n	<xsd:complexType name=\"objectPropertiesType\">\n		<xsd:sequence>\n			<xsd:element name=\"property\" type=\"propertyType\" maxOccurs=\"unbounded\"/>\n			<xsd:element name=\"extproperty\" type=\"extpropertyType\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\n\n		</xsd:sequence>\n	</xsd:complexType>\n	<xsd:complexType name=\"datastreamType\">\n		<xsd:sequence>\n			<xsd:element name=\"datastreamVersion\" type=\"datastreamVersionType\" maxOccurs=\"unbounded\"/>\n		</xsd:sequence>\n		<xsd:attribute name=\"ID\" type=\"idType\" use=\"required\"/>\n		<xsd:attribute name=\"CONTROL_GROUP\" use=\"required\">\n			<xsd:simpleType>\n\n				<xsd:restriction base=\"xsd:string\">\n					<xsd:enumeration value=\"E\"/>\n					<xsd:enumeration value=\"M\"/>\n					<xsd:enumeration value=\"R\"/>\n					<xsd:enumeration value=\"X\"/>\n					<xsd:enumeration value=\"B\"/>\n				</xsd:restriction>\n			</xsd:simpleType>\n		</xsd:attribute>\n\n		<xsd:attribute name=\"FEDORA_URI\" type=\"xsd:anyURI\" use=\"optional\"/>\n		<xsd:attribute name=\"STATE\" type=\"stateType\" use=\"optional\"/>\n		<xsd:attribute name=\"VERSIONABLE\" type=\"xsd:boolean\" use=\"optional\" default=\"true\"/>\n\n	</xsd:complexType>\n	<xsd:complexType name=\"datastreamVersionType\">\n		<xsd:sequence>\n			<xsd:choice>\n				<xsd:element name=\"xmlContent\" type=\"xmlContentType\"/>\n\n				<xsd:element name=\"contentLocation\" type=\"contentLocationType\"/>\n				<xsd:element name=\"binaryContent\" type=\"xsd:base64Binary\"/>\n			</xsd:choice>\n			<xsd:element name=\"contentDigest\" type=\"contentDigestType\" minOccurs=\"0\"/>\n		</xsd:sequence>\n		<xsd:attribute name=\"ID\" type=\"idType\" use=\"required\"/>\n		<xsd:attribute name=\"LABEL\" type=\"xsd:string\" use=\"optional\"/>\n		<xsd:attribute name=\"CREATED\" type=\"xsd:dateTime\" use=\"optional\"/>\n		<xsd:attribute name=\"MIMETYPE\" type=\"xsd:string\" use=\"required\"/>\n\n		<xsd:attribute name=\"ALT_IDS\" type=\"uriListType\" use=\"optional\"/>\n		<xsd:attribute name=\"FORMAT_URI\" type=\"xsd:anyURI\" use=\"optional\"/>\n		<xsd:attribute name=\"SIZE\" type=\"xsd:long\" use=\"optional\" default=\"0\"/>\n	</xsd:complexType>\n	<xsd:complexType name=\"contentDigestType\">\n		<xsd:attribute name=\"TYPE\" use=\"required\">\n			<xsd:simpleType>\n				<xsd:restriction base=\"xsd:string\">\n					<xsd:enumeration value=\"MD5\"/>\n\n					<xsd:enumeration value=\"SHA-1\"/>\n					<xsd:enumeration value=\"SHA-256\"/>\n					<xsd:enumeration value=\"SHA-384\"/>\n					<xsd:enumeration value=\"SHA-512\"/>\n					<xsd:enumeration value=\"HAVAL\"/>\n					<xsd:enumeration value=\"TIGER\"/>\n					<xsd:enumeration value=\"WHIRLPOOL\"/>\n				</xsd:restriction>\n			</xsd:simpleType>\n\n		</xsd:attribute>\n		<xsd:attribute name=\"DIGEST\" type=\"xsd:string\" use=\"required\"/>\n	</xsd:complexType>\n	<xsd:complexType name=\"xmlContentType\">\n		<xsd:sequence>\n			<xsd:any namespace=\"##any\" processContents=\"skip\" maxOccurs=\"unbounded\"/>\n		</xsd:sequence>\n	</xsd:complexType>\n	<xsd:complexType name=\"contentLocationType\">\n\n		<xsd:attribute name=\"TYPE\" use=\"required\">\n			<xsd:simpleType>\n				<xsd:restriction base=\"xsd:string\">\n					<xsd:enumeration value=\"INTERNAL_ID\"/>\n					<xsd:enumeration value=\"URL\"/>\n				</xsd:restriction>\n			</xsd:simpleType>\n		</xsd:attribute>\n		<xsd:attribute name=\"REF\" use=\"required\">\n\n			<xsd:simpleType>\n				<xsd:restriction base=\"xsd:anyURI\">\n					<xsd:minLength value=\"1\"/>\n				</xsd:restriction>\n			</xsd:simpleType>\n			<!--<xsd:simpleType>-->\n			<!-- <xsd:restriction base=\"xsd:token\">-->\n			<!--<xsd:minLength value=\"1\"/>-->\n			<!--</xsd:restriction>-->\n\n			<!--</xsd:simpleType>-->\n		</xsd:attribute>\n	</xsd:complexType>\n	<xsd:complexType name=\"disseminatorType\">\n		<xsd:sequence>\n			<xsd:element name=\"disseminatorVersion\" type=\"disseminatorVersionType\" maxOccurs=\"unbounded\"/>\n		</xsd:sequence>\n		<xsd:attribute name=\"ID\" type=\"idType\" use=\"required\"/>\n		<xsd:attribute name=\"BDEF_CONTRACT_PID\" use=\"required\">\n\n			<xsd:simpleType>\n				<xsd:restriction base=\"nonEmptyStringType\">\n					<xsd:maxLength value=\"64\"/>\n				</xsd:restriction>\n			</xsd:simpleType>\n		</xsd:attribute>\n		<xsd:attribute name=\"STATE\" type=\"stateType\" use=\"optional\"/>\n		<xsd:attribute name=\"VERSIONABLE\" type=\"xsd:boolean\" use=\"optional\" default=\"true\"/>\n	</xsd:complexType>\n\n	<xsd:complexType name=\"disseminatorVersionType\">\n		<xsd:sequence>\n			<xsd:element name=\"serviceInputMap\" type=\"serviceInputMapType\" minOccurs=\"0\"/>\n		</xsd:sequence>\n		<xsd:attribute name=\"ID\" type=\"idType\" use=\"required\"/>\n		<xsd:attribute name=\"BMECH_SERVICE_PID\" use=\"required\">\n			<xsd:simpleType>\n				<xsd:restriction base=\"nonEmptyStringType\">\n					<xsd:maxLength value=\"64\"/>\n\n				</xsd:restriction>\n			</xsd:simpleType>\n		</xsd:attribute>\n		<xsd:attribute name=\"CREATED\" type=\"xsd:dateTime\" use=\"optional\"/>\n		<xsd:attribute name=\"LABEL\" type=\"xsd:string\" use=\"optional\"/>\n	</xsd:complexType>\n	<xsd:complexType name=\"serviceInputMapType\">\n		<xsd:sequence>\n			<xsd:element name=\"datastreamBinding\" type=\"datastreamBindingType\" maxOccurs=\"unbounded\"/>\n\n		</xsd:sequence>\n	</xsd:complexType>\n	<xsd:complexType name=\"datastreamBindingType\">\n		<xsd:attribute name=\"KEY\" use=\"required\">\n			<xsd:simpleType>\n				<xsd:restriction base=\"nonEmptyStringType\">\n					<xsd:maxLength value=\"64\"/>\n				</xsd:restriction>\n			</xsd:simpleType>\n\n		</xsd:attribute>\n		<xsd:attribute name=\"DATASTREAM_ID\" type=\"xsd:IDREF\" use=\"required\"/>\n		<xsd:attribute name=\"LABEL\" type=\"xsd:string\" use=\"optional\"/>\n		<xsd:attribute name=\"ORDER\" type=\"xsd:string\" use=\"optional\"/>\n	</xsd:complexType>\n	<xsd:complexType name=\"propertyType\">\n		<xsd:attribute name=\"NAME\" use=\"required\">\n			<xsd:simpleType>\n				<xsd:restriction base=\"xsd:string\">\n\n					<xsd:enumeration value=\"http://www.w3.org/1999/02/22-rdf-syntax-ns#type\"/>\n					<xsd:enumeration value=\"info:fedora/fedora-system:def/model#state\"/>\n					<xsd:enumeration value=\"info:fedora/fedora-system:def/model#label\"/>\n					<xsd:enumeration value=\"info:fedora/fedora-system:def/model#createdDate\"/>\n					<xsd:enumeration value=\"info:fedora/fedora-system:def/view#lastModifiedDate\"/>\n					<xsd:enumeration value=\"info:fedora/fedora-system:def/model#contentModel\"/>\n				</xsd:restriction>\n			</xsd:simpleType>\n		</xsd:attribute>\n\n		<xsd:attribute name=\"VALUE\" type=\"xsd:string\" use=\"required\"/>\n	</xsd:complexType>\n	<xsd:complexType name=\"extpropertyType\">\n		<xsd:attribute name=\"NAME\" type=\"xsd:string\" use=\"required\"/>\n		<xsd:attribute name=\"VALUE\" type=\"xsd:string\" use=\"required\"/>\n	</xsd:complexType>\n	<xsd:simpleType name=\"stateType\">\n		<xsd:restriction base=\"xsd:string\">\n			<xsd:enumeration value=\"A\"/>\n\n			<xsd:enumeration value=\"D\"/>\n			<xsd:enumeration value=\"I\"/>\n		</xsd:restriction>\n	</xsd:simpleType>\n	<!-- See http://www.fedora.info/definitions/identifiers/ -->\n	<xsd:simpleType name=\"pidType\">\n		<xsd:restriction base=\"xsd:string\">\n			<xsd:maxLength value=\"64\"/>\n			<xsd:pattern value=\"([A-Za-z0-9]|-|\\.)+:(([A-Za-z0-9])|-|\\.|~|_|(%[0-9A-F]{2}))+\"/>\n\n		</xsd:restriction>\n	</xsd:simpleType>\n	<xsd:simpleType name=\"nonEmptyStringType\">\n		<xsd:restriction base=\"xsd:string\">\n			<xsd:minLength value=\"1\"/>\n		</xsd:restriction>\n	</xsd:simpleType>\n	<xsd:simpleType name=\"idType\">\n		<xsd:restriction base=\"xsd:ID\">\n\n			<xsd:maxLength value=\"64\"/>\n		</xsd:restriction>\n	</xsd:simpleType>\n	<xsd:simpleType name=\"uriListType\">\n		<xsd:list itemType=\"xsd:anyURI\"/>\n	</xsd:simpleType>\n</xsd:schema>\n','digitalObject','foxml',''),
	(25,'OAI DC','2.0','<xs:schema targetNamespace=\"http://www.openarchives.org/OAI/2.0/oai_dc/\" \n        xmlns:xs=\"http://www.w3.org/2001/XMLSchema\"\n        xmlns:oai_dc=\"http://www.openarchives.org/OAI/2.0/oai_dc/\" \n        xmlns:dc=\"http://purl.org/dc/elements/1.1/\" \n        xmlns=\"http://www.w3.org/2001/XMLSchema\" \n        elementFormDefault=\"qualified\" attributeFormDefault=\"unqualified\">\n	\n<xs:annotation>\n  <xs:documentation> \n      XML Schema 2002-03-18 by Pete Johnston.\n      Adjusted for usage in the OAI-PMH.\n      Schema imports the Dublin Core elements from the DCMI schema for unqualified Dublin Core.\n      2002-12-19 updated to use simpledc20021212.xsd (instead of simpledc20020312.xsd)\n  </xs:documentation>\n</xs:annotation>\n\n<import namespace=\"http://purl.org/dc/elements/1.1/\" \n        schemaLocation=\"http://dublincore.org/schemas/xmls/simpledc20021212.xsd\"/>\n\n<xs:element name=\"dc\" type=\"oai_dcType\"/>\n	\n<xs:complexType name=\"oai_dcType\">\n  <xs:choice minOccurs=\"0\" maxOccurs=\"unbounded\">\n    <xs:element ref=\"dc:title\"/>\n    <xs:element ref=\"dc:creator\"/>\n    <xs:element ref=\"dc:subject\"/>\n    <xs:element ref=\"dc:description\"/>\n    <xs:element ref=\"dc:publisher\"/>\n    <xs:element ref=\"dc:contributor\"/>\n    <xs:element ref=\"dc:date\"/>\n    <xs:element ref=\"dc:type\"/>\n    <xs:element ref=\"dc:format\"/>\n    <xs:element ref=\"dc:identifier\"/>\n    <xs:element ref=\"dc:source\"/>\n    <xs:element ref=\"dc:language\"/>\n    <xs:element ref=\"dc:relation\"/>\n    <xs:element ref=\"dc:coverage\"/>\n    <xs:element ref=\"dc:rights\"/>\n  </xs:choice>\n</xs:complexType>\n\n<xs:complexType  name=\"authorIDType\">\n  <xs:attribute name=\"authorID\"  type=\"xsd:string\" use=\"optional\"/>\n</xs:complexType>\n\n<xs:complexType  name=\"dateType\">\n  <xs:attribute name=\"dateType\"  type=\"xsd:string\" use=\"optional\"/>\n</xs:complexType>\n\n\n  <xs:element name=\"dc:title\"/>\n  <xs:element name=\"dc:creator\" type=\"authorIDType\"/>\n  <xs:element name=\"dc:subject\"/>\n  <xs:element name=\"dc:description\"/>\n  <xs:element name=\"dc:publisher\"/>\n  <xs:element name=\"dc:contributor\"/>\n  <xs:element name=\"dc:date\" type=\"dateType\"/>\n  <xs:element name=\"dc:type\"/>\n  <xs:element name=\"dc:format\"/>\n  <xs:element name=\"dc:identifier\"/>\n  <xs:element name=\"dc:source\"/>\n  <xs:element name=\"dc:language\"/>\n  <xs:element name=\"dc:relation\"/>\n  <xs:element name=\"dc:coverage\"/>\n  <xs:element name=\"dc:rights\"/>\n\n</xs:schema>','dc','oai_dc',''),
	(27,'RELS-EXT','1.0 - isMemberOf isD','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<xsd:schema xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\" targetNamespace=\"http://www.w3.org/1999/02/22-rdf-syntax-ns#\" xmlns:rel=\"info:fedora/fedora-system:def/relations-external#\">\r\n\r\n<!-- the root element for RELS-EXT-->\r\n<xsd:element name=\"RDF\" type=\"RDFType\"/>\r\n\r\n<xsd:complexType name=\"RDFType\">\r\n    <xsd:sequence>\r\n      <xsd:element name=\"description\" type=\"descriptionType\" />\r\n    </xsd:sequence>\r\n</xsd:complexType>\r\n\r\n<xsd:complexType name=\"descriptionType\" about=\"\">\r\n  <xsd:sequence>\r\n        <xsd:attribute name=\"about\" />\r\n        <xsd:element name=\"isMemberOf\">\r\n            <xsd:attribute name=\"resource\" />\r\n        </xsd:element>\r\n        <xsd:element name=\"isDerivationOf\">\r\n            <xsd:attribute name=\"resource\" />\r\n        </xsd:element>\r\n        <xsd:element name=\"isDatasetOf\">\r\n            <xsd:attribute name=\"resource\" />\r\n        </xsd:element>\r\n  </xsd:sequence>\r\n</xsd:complexType>\r\n\r\n\r\n</xsd:schema>','RDF','rdf','rel'),
	(28,'FezMD','1.0','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<xsd:schema xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\" elementFormDefault=\"qualified\" attributeFormDefault=\"unqualified\">\r\n	<!--============================================================\r\n\r\n	 FezMD: Fez Metadata Extension Schema\r\n		\r\n	============================================================-->\r\n	<xsd:element name=\"FezMD\" type=\"FezMDType\"/>\r\n	<xsd:element name=\"xdis_id\" />\r\n	<xsd:element name=\"sta_id\" />\r\n	<xsd:element name=\"ret_id\" />\r\n	<xsd:element name=\"usr_id\" />\r\n	<xsd:element name=\"grp_id\" />\r\n	<xsd:element name=\"child_xdis_id_option\" />\r\n	<xsd:element name=\"publication\" />\r\n	<xsd:element name=\"copyright\" />\r\n	<xsd:element name=\"keyword\" />\r\n	<xsd:element name=\"created_date\" />\r\n	<xsd:element name=\"updated_date\" />\r\n	<xsd:element name=\"depositor\" />\r\n	<xsd:element name=\"depositor_affiliation\" />\r\n	<xsd:element name=\"additional_notes\" />\r\n	<xsd:element name=\"refereed\" />\r\n	<xsd:element name=\"refereed_source\" />\r\n	<xsd:element name=\"reference_text\" />\r\n	<xsd:element name=\"herdc_status\" />\r\n	<xsd:element name=\"institutional_status\" />\r\n	<xsd:element name=\"follow_up\" />\r\n	<xsd:element name=\"follow_up_imu\" />\r\n	<xsd:element name=\"scopus_doc_type\" />\r\n	<xsd:element name=\"wok_doc_type\" />\r\n        <xsd:element name=\"author_count\" />\r\n	<xsd:complexType name=\"FezMDType\">\r\n		<xsd:sequence>\r\n			<xsd:element ref=\"xdis_id\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"sta_id\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element ref=\"ret_id\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"usr_id\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"grp_id\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"child_xdis_id_option\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"publication\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"copyright\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"keyword\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"created_date\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"updated_date\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"depositor\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"depositor_affiliation\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"additional_notes\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"refereed\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"refereed_source\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"reference_text\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"herdc_status\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"institutional_status\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"follow_up\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"follow_up_imu\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"scopus_doc_type\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"wok_doc_type\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n                        <xsd:element ref=\"author_count\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n		</xsd:sequence>\r\n	</xsd:complexType>\r\n</xsd:schema>','FezMD','',''),
	(29,'FezACML','1.0','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<xsd:schema xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\">\r\n\r\n<!-- the root element for RELS-EXT-->\r\n<xsd:element name=\"FezACML\" type=\"FezACMLType\"/>\r\n\r\n<xsd:complexType name=\"FezACMLType\">\r\n    <xsd:sequence>\r\n      <xsd:element name=\"rule\" type=\"ruleType\" />\r\n      <xsd:element name=\"inherit_security\"/>\r\n      <xsd:element name=\"datastream_quickauth_template\" />\r\n      <xsd:element name=\"image_copyright\" />\r\n      <xsd:element name=\"image_watermark\" />\r\n    </xsd:sequence>\r\n</xsd:complexType>\r\n\r\n<xsd:complexType name=\"ruleType\">\r\n    <xsd:sequence>\r\n      <xsd:element name=\"role\" type=\"roleType\" />\r\n    </xsd:sequence>\r\n</xsd:complexType>\r\n\r\n\r\n<xsd:complexType name=\"roleType\">\r\n  <xsd:sequence>\r\n        <xsd:attribute name=\"name\"/>\r\n        <xsd:element name=\"in_AD\"/>\r\n        <xsd:element name=\"AD_Group\"/>\r\n        <xsd:element name=\"AD_User\"/>        \r\n        <xsd:element name=\"AD_DistinguishedName\"/>\r\n        <xsd:element name=\"in_Fez\"/>\r\n        <xsd:element name=\"Fez_Group\"/>        \r\n        <xsd:element name=\"Fez_User\"/>\r\n        <xsd:element name=\"eduPersonTargetedID\"/>\r\n        <xsd:element name=\"eduPersonAffiliation\"/>\r\n        <xsd:element name=\"eduPersonScopedAffiliation\"/>\r\n        <xsd:element name=\"eduPersonPrimaryAffiliation\"/>\r\n        <xsd:element name=\"eduPersonPrincipalName\"/>\r\n        <xsd:element name=\"eduPersonOrgUnitDN\"/>\r\n        <xsd:element name=\"eduPersonPrimaryOrgUnitDN\"/>\r\n  </xsd:sequence>\r\n</xsd:complexType>\r\n\r\n\r\n</xsd:schema>\r\n','FezACML','',''),
	(51,'MODS','3.2 without Related ','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<!-- edited with XML Spy v4.4 U (http://www.xmlspy.com) by Ray Denenberg  (Library of Congress) -->\r\n<xsd:schema xmlns:xlink=\"http://www.w3.org/1999/xlink\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\" xmlns=\"http://www.loc.gov/mods/v3\" targetNamespace=\"http://www.loc.gov/mods/v3\" elementFormDefault=\"qualified\" attributeFormDefault=\"unqualified\">\r\n	<xsd:import namespace=\"http://www.w3.org/XML/1998/namespace\" schemaLocation=\"http://www.w3.org/2001/xml.xsd\"/>\r\n	<xsd:import namespace=\"http://www.w3.org/1999/xlink\" schemaLocation=\"http://www.loc.gov/standards/xlink.xsd\"/>\r\n	<!-- \r\n\r\nMODS 3.2\r\nJune 1, 2006	\r\n\r\n***************************  List of changes from 3.1:\r\n\r\n1. <location><url>\r\n1.1. Added attribute \"note\" to allow for notes associated with the link.  \r\n    Tentative plan for 4.0 is to make it an element instead of an attribute, \r\n    and  wrap <url> and <urlNote> together. Can\'t do that in 3.2 \r\n    because it would not be compatible with 3.1. \r\n1.2. Added attribute \"access\",  enumerated list with values:\r\npreview\r\nraw object\r\nobject in context\r\n1.3  Add attribute \'usage\' under <url> with one enumerated value: \"primary display\".\r\n\r\n2. <physicalDescription><digitalOrigin>\r\nAdded enumerated values: \r\ndigitized microfilm \r\ndigitized other analog \r\n\r\n3. <part>\r\n3.1. Added attributes ID, type, order \r\n3.2. <part> may now be empty (minOccurs 0 on choice)\r\n\r\n4. ID attribute added.\r\n4.1 to relatedItem\r\n4.2 to note.\r\n\r\n5. The following  elements have been globalized:\r\n5.1 <dateCaptured>  (under <originInfo>)  dateCapturedType defined\r\n5.2 <edition> (under <originInfo> editionType defined\r\n5.3 <physicalLocation> (under <location>) physicalLocationType defined\r\n\r\n6. Elements whose type had been assumed to be \"string\",\r\n    but had not been explicitly typed, are now typed. \r\n\r\n7.  Add  subelement <genre> under <subject>.\r\n\r\n8. The schema location reference for xlink is changed to \r\n    http://www.loc.gov/standards/xlink.xsd. \r\n   (It was previously http://www.loc.gov/standards/mods/xlink.xsd. \r\n   The schema now resides in both places so that earlier versions \r\n    will not be affected, but it is now intended that the new copy \r\n    be referenced, outside of the mods directory, \r\n   so that other projects, e.g. mets, may reference it.)\r\n\r\n\r\n********************** end list of changes from 3.1\r\n\r\n\r\n*****  An instance of this schema is \r\n\r\n (1) a single MODS record:  \r\n	 -->\r\n	<xsd:element name=\"mods\" type=\"modsType\"/>\r\n	<!--  \r\nor \r\n\r\n(2) a collection of MODS records:  -->\r\n	<xsd:element name=\"modsCollection\">\r\n		<xsd:complexType>\r\n			<xsd:sequence>\r\n				<xsd:element ref=\"mods\" maxOccurs=\"unbounded\"/>\r\n			</xsd:sequence>\r\n		</xsd:complexType>\r\n	</xsd:element>\r\n	<!--  \r\n\r\n*****  End of \"instance\" definition\r\n\r\n******* Group definition. Forms the basis of the mods \r\n     record definintion, and also relatedItem. \r\n   Difference is that mods requires at least one element \r\n   and relatedItem does not.\r\n\r\n-->\r\n	<xsd:group name=\"modsGroup\">\r\n		<xsd:choice>\r\n			<xsd:element name=\"titleInfo\" type=\"titleInfoType\"/>\r\n			<xsd:element name=\"name\" type=\"nameType\"/>\r\n			<xsd:element name=\"typeOfResource\" type=\"typeOfResourceType\"/>\r\n			<xsd:element name=\"genre\" type=\"genreType\"/>\r\n			<xsd:element name=\"originInfo\" type=\"originInfoType\"/>\r\n			<xsd:element name=\"language\" type=\"languageType\"/>\r\n			<xsd:element name=\"physicalDescription\" type=\"physicalDescriptionType\"/>\r\n			<xsd:element name=\"abstract\" type=\"abstractType\"/>\r\n			<xsd:element name=\"tableOfContents\" type=\"tableOfContentsType\"/>\r\n			<xsd:element name=\"targetAudience\" type=\"targetAudienceType\"/>\r\n			<xsd:element name=\"note\" type=\"noteType\"/>\r\n			<xsd:element name=\"subject\" type=\"subjectType\"/>\r\n			<xsd:element name=\"classification\" type=\"classificationType\"/>\r\n			<xsd:element name=\"relatedItem\" type=\"relatedItemType\"/>\r\n			<xsd:element name=\"identifier\" type=\"identifierType\"/>\r\n			<xsd:element name=\"location\" type=\"locationType\"/>\r\n			<xsd:element name=\"accessCondition\" type=\"accessConditionType\"/>\r\n			<xsd:element name=\"part\" type=\"partType\"/>\r\n			<xsd:element name=\"extension\" type=\"extensionType\"/>\r\n			<xsd:element name=\"recordInfo\" type=\"recordInfoType\"/>\r\n		</xsd:choice>\r\n	</xsd:group>\r\n	<!--\r\n*****  Definition of a single MODS record\r\n-->\r\n	<xsd:complexType name=\"modsType\">\r\n		<xsd:group ref=\"modsGroup\" maxOccurs=\"unbounded\"/>\r\n		<xsd:attribute name=\"ID\" type=\"xsd:ID\" use=\"optional\"/>\r\n		<xsd:attribute name=\"version\" type=\"versionType\"/>\r\n	</xsd:complexType>\r\n	<!--\r\n*****  End of definition of a MODS record.\r\n \r\n***** Data type definitions for top level elements follow\r\n\r\n ********** titleInfoType definition **********\r\n -->\r\n	<xsd:complexType name=\"titleInfoType\">\r\n		<xsd:complexContent>\r\n			<xsd:extension base=\"baseTitleInfoType\">\r\n				<xsd:attribute name=\"type\" use=\"optional\">\r\n					<xsd:simpleType>\r\n						<xsd:annotation>\r\n							<xsd:documentation>if this attribute is omitted, then title relates to 245$a  $b  $n  and $p</xsd:documentation>\r\n						</xsd:annotation>\r\n						<xsd:restriction base=\"xsd:string\">\r\n							<xsd:enumeration value=\"abbreviated\">\r\n								<xsd:annotation>\r\n									<xsd:documentation>210</xsd:documentation>\r\n								</xsd:annotation>\r\n							</xsd:enumeration>\r\n							<xsd:enumeration value=\"translated\">\r\n								<xsd:annotation>\r\n									<xsd:documentation>242</xsd:documentation>\r\n								</xsd:annotation>\r\n							</xsd:enumeration>\r\n							<xsd:enumeration value=\"alternative\">\r\n								<xsd:annotation>\r\n									<xsd:documentation>246</xsd:documentation>\r\n								</xsd:annotation>\r\n							</xsd:enumeration>\r\n							<xsd:enumeration value=\"uniform\">\r\n								<xsd:annotation>\r\n									<xsd:documentation>240, 130</xsd:documentation>\r\n								</xsd:annotation>\r\n							</xsd:enumeration>\r\n						</xsd:restriction>\r\n					</xsd:simpleType>\r\n				</xsd:attribute>\r\n			</xsd:extension>\r\n		</xsd:complexContent>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"baseTitleInfoType\">\r\n		<xsd:choice minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n			<xsd:element name=\"title\" type=\"xsd:string\"/>\r\n			<xsd:element name=\"subTitle\" type=\"xsd:string\"/>\r\n			<xsd:element name=\"partNumber\" type=\"xsd:string\"/>\r\n			<xsd:element name=\"partName\" type=\"xsd:string\"/>\r\n			<xsd:element name=\"nonSort\" type=\"xsd:string\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>All characters, including space, up to the first sort character.</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n		</xsd:choice>\r\n		<xsd:attribute name=\"ID\" type=\"xsd:ID\" use=\"optional\"/>\r\n		<xsd:attributeGroup ref=\"xlink:simpleLink\"/>\r\n		<xsd:attributeGroup ref=\"language\"/>\r\n		<xsd:attribute name=\"authority\" type=\"xsd:string\" use=\"optional\"/>\r\n		<xsd:attribute name=\"displayLabel\" use=\"optional\" type=\"xsd:string\"/>\r\n	</xsd:complexType>\r\n	<!-- \r\n **********  nameType definition  **********   		\r\n-->\r\n	<xsd:complexType name=\"nameType\">\r\n		<xsd:choice minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n			<xsd:element name=\"namePart\" type=\"namePartType\"/>\r\n			<xsd:element name=\"displayForm\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>245$c</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"affiliation\" type=\"xsd:string\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>100, 700 $u</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"role\" type=\"roleType\"/>\r\n			<xsd:element name=\"description\" type=\"xsd:string\"/>\r\n		</xsd:choice>\r\n		<xsd:attribute name=\"ID\" type=\"xsd:ID\" use=\"optional\"/>\r\n		<xsd:attribute name=\"type\" type=\"nameTypeAttribute\" use=\"optional\"/>\r\n		<xsd:attribute name=\"authority\" use=\"optional\" type=\"xsd:string\">\r\n			<xsd:annotation>\r\n				<xsd:documentation>Value is from the list at  \r\n				http:/www.loc.gov/marc/sourcecode/authorityfile/authorityfilesource.html\r\n				</xsd:documentation>\r\n			</xsd:annotation>\r\n		</xsd:attribute>\r\n		<xsd:attributeGroup ref=\"xlink:simpleLink\"/>\r\n		<xsd:attributeGroup ref=\"language\"/>\r\n		<!--\r\n***** End declaration of elements for nameType.  \r\n\r\n***** Begin declaration of attributes for nameType.\r\n-->\r\n	</xsd:complexType>\r\n	<!--  \r\n***** Begin definition of subordinate types for nameType.\r\n-->\r\n	<xsd:complexType name=\"namePartType\">\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:string\">\r\n				<xsd:attribute name=\"ID\" use=\"optional\"/>\r\n				<xsd:attribute name=\"type\" use=\"optional\">\r\n					<xsd:simpleType>\r\n						<xsd:restriction base=\"xsd:string\">\r\n							<xsd:enumeration value=\"date\"/>\r\n							<xsd:enumeration value=\"family\"/>\r\n							<xsd:enumeration value=\"given\"/>\r\n							<xsd:enumeration value=\"termsOfAddress\"/>\r\n						</xsd:restriction>\r\n					</xsd:simpleType>\r\n				</xsd:attribute>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n        <xsd:complexType name=\"publisherType\">\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:string\">\r\n				<xsd:attribute name=\"ID\" use=\"optional\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"roleType\">\r\n		<xsd:sequence maxOccurs=\"unbounded\">\r\n			<xsd:element name=\"roleTerm\">\r\n				<xsd:complexType>\r\n					<xsd:annotation>\r\n						<xsd:documentation>if it is a code: 100, 110, 111, 700, 710, 711 $4.\r\n					If it is text:100, 110, 700, 710 $e.		\r\n					</xsd:documentation>\r\n					</xsd:annotation>\r\n					<xsd:simpleContent>\r\n						<xsd:extension base=\"xsd:string\">\r\n							<xsd:attribute name=\"authority\" use=\"optional\" type=\"xsd:string\">\r\n								<xsd:annotation>\r\n									<xsd:documentation>The value of this attribute is from list at http://www.loc.gov/marc/sourcecode/relator/relatorsource.html.  If the value is \"marcrelator\" the content is from list at http://www.loc.gov/marc/sourcecode/relator/relatorlist.html\r\n </xsd:documentation>\r\n								</xsd:annotation>\r\n							</xsd:attribute>\r\n							<xsd:attribute name=\"type\" type=\"codeOrText\" use=\"optional\"/>\r\n						</xsd:extension>\r\n					</xsd:simpleContent>\r\n				</xsd:complexType>\r\n			</xsd:element>\r\n		</xsd:sequence>\r\n	</xsd:complexType>\r\n	<!--\r\n***** End definition of nameType.\r\n-->\r\n	<!--\r\n********** typeOfResourceType  definition **********   	  \r\n -->\r\n	<xsd:complexType name=\"typeOfResourceType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>LDR/6</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"resourceType\">\r\n				<xsd:attribute name=\"collection\" use=\"optional\">\r\n					<xsd:simpleType>\r\n						<xsd:restriction base=\"xsd:string\">\r\n							<xsd:enumeration value=\"yes\"/>\r\n						</xsd:restriction>\r\n					</xsd:simpleType>\r\n				</xsd:attribute>\r\n				<xsd:attribute name=\"manuscript\" use=\"optional\">\r\n					<xsd:simpleType>\r\n						<xsd:restriction base=\"xsd:string\">\r\n							<xsd:enumeration value=\"yes\"/>\r\n						</xsd:restriction>\r\n					</xsd:simpleType>\r\n				</xsd:attribute>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<xsd:simpleType name=\"resourceType\">\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"text\"/>\r\n			<xsd:enumeration value=\"cartographic\"/>\r\n			<xsd:enumeration value=\"notated music\"/>\r\n			<xsd:enumeration value=\"sound recording-musical\"/>\r\n			<xsd:enumeration value=\"sound recording-nonmusical\"/>\r\n			<xsd:enumeration value=\"sound recording\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>Use for mixed musical and nonmusical, or when not specified whether musical or nonmusical.\r\n</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:enumeration>\r\n			<xsd:enumeration value=\"still image\"/>\r\n			<xsd:enumeration value=\"moving image\"/>\r\n			<xsd:enumeration value=\"three dimensional object\"/>\r\n			<xsd:enumeration value=\"software, multimedia\"/>\r\n			<xsd:enumeration value=\"mixed material\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n	<!--  \r\n********** genreType defintion  **********  	\r\n-->\r\n	<xsd:complexType name=\"genreType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>008/26, 008/33, 008/29, 008/30,  008/24+, 008/21, 008/25, 655</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:string\">\r\n				<xsd:attribute name=\"type\" use=\"optional\" type=\"xsd:string\"/>\r\n				<xsd:attribute name=\"authority\" use=\"optional\" type=\"xsd:string\">\r\n					<xsd:annotation>\r\n						<xsd:documentation> Value of this attribute may be from the list at:http://www.loc.gov/marc/sourcecode/genre/genresource.html.  If so, and if  the value is \'marcgt\' then the content is from list at http://www.loc.gov/marc/sourcecode/genre/genrelist.html.  The value may instead be a uri. </xsd:documentation>\r\n					</xsd:annotation>\r\n				</xsd:attribute>\r\n				<xsd:attributeGroup ref=\"language\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<!--  \r\n ********** originInfoType definition  ********** \r\n-->\r\n	<xsd:complexType name=\"originInfoType\">\r\n		<xsd:choice maxOccurs=\"unbounded\">\r\n			<xsd:element name=\"place\" type=\"placeType\"/>\r\n			<xsd:element name=\"publisher\" type=\"publisherType\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>260 $b</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"dateIssued\" type=\"dateType\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>260$c, 008/07-14</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"dateCreated\" type=\"dateType\"/>\r\n			<xsd:element name=\"dateCaptured\" type=\"dateCapturedType\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>033</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"dateValid\" type=\"dateType\"/>\r\n			<xsd:element name=\"dateModified\" type=\"dateType\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>date resource modified, not record modified</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"copyrightDate\" type=\"dateType\"/>\r\n			<xsd:element name=\"dateOther\" type=\"dateOtherType\"/>\r\n			<xsd:element name=\"edition\" type=\"editionType\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>250</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"issuance\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>LDR/7</xsd:documentation>\r\n				</xsd:annotation>\r\n				<xsd:simpleType>\r\n					<xsd:restriction base=\"xsd:string\">\r\n						<xsd:enumeration value=\"continuing\"/>\r\n						<xsd:enumeration value=\"monographic\"/>\r\n					</xsd:restriction>\r\n				</xsd:simpleType>\r\n			</xsd:element>\r\n			<xsd:element name=\"frequency\" type=\"xsd:string\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>310</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n		</xsd:choice>\r\n		<xsd:attributeGroup ref=\"language\"/>\r\n	</xsd:complexType>\r\n	<!-- \r\n\r\n*****   Subordinate datatype for originInfo\r\n-->\r\n	<xsd:complexType name=\"placeType\">\r\n		<xsd:sequence>\r\n			<xsd:element name=\"placeTerm\" type=\"placeTermType\" maxOccurs=\"unbounded\"/>\r\n		</xsd:sequence>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"placeTermType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>260 $a if text. 008/15-17, 044 if a code</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:string\">\r\n				<xsd:attribute name=\"authority\" type=\"placeAuthority\" use=\"optional\"/>\r\n				<xsd:attribute name=\"type\" type=\"codeOrText\" use=\"optional\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"dateCapturedType\">\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"dateType\"/>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<xsd:simpleType name=\"editionType\">\r\n		<xsd:restriction base=\"xsd:string\"/>\r\n	</xsd:simpleType>\r\n	<!--   	 \r\n\r\n***** End definition of originInfo.\r\n\r\n********** languageType definition  **********  	                      	\r\n-->\r\n	<xsd:complexType name=\"languageType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>008/35-37, 041</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:sequence>\r\n			<xsd:element name=\"languageTerm\" maxOccurs=\"unbounded\">\r\n				<xsd:complexType>\r\n					<xsd:simpleContent>\r\n						<xsd:extension base=\"xsd:string\">\r\n							<xsd:attribute name=\"authority\" use=\"optional\">\r\n								<xsd:simpleType>\r\n									<xsd:restriction base=\"xsd:string\">\r\n										<xsd:enumeration value=\"rfc3066\"/>\r\n										<xsd:enumeration value=\"iso639-2b\"/>\r\n									</xsd:restriction>\r\n								</xsd:simpleType>\r\n							</xsd:attribute>\r\n							<xsd:attribute name=\"type\" type=\"codeOrText\" use=\"optional\"/>\r\n						</xsd:extension>\r\n					</xsd:simpleContent>\r\n				</xsd:complexType>\r\n			</xsd:element>\r\n		</xsd:sequence>\r\n		<xsd:attribute name=\"objectPart\"  type=\"xsd:string\" use=\"optional\"/>\r\n	</xsd:complexType>\r\n	<!-- \r\n********** physicalDescriptionType definition **********  		 		\r\n -->\r\n	<xsd:complexType name=\"physicalDescriptionType\">\r\n		<xsd:choice maxOccurs=\"unbounded\">\r\n			<xsd:element name=\"form\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>008/23 or 29, 256</xsd:documentation>\r\n				</xsd:annotation>\r\n				<xsd:complexType>\r\n					<xsd:simpleContent>\r\n						<xsd:extension base=\"xsd:string\">\r\n							<xsd:attribute name=\"type\" use=\"optional\"  type=\"xsd:string\"/>\r\n							<xsd:attribute name=\"authority\" use=\"optional\"  type=\"xsd:string\">\r\n								<xsd:annotation>\r\n									<xsd:documentation>The value of this attribute is from the list at http://www.loc.gov/marc/sourcecode/form/formsource.html. If the value is \"marcform\" the content is from list at:\r\nhttp://www.loc.gov/marc/sourcecode/form/formlist.html\r\n\r\n\r\n						</xsd:documentation>\r\n								</xsd:annotation>\r\n							</xsd:attribute>\r\n						</xsd:extension>\r\n					</xsd:simpleContent>\r\n				</xsd:complexType>\r\n			</xsd:element>\r\n			<xsd:element name=\"reformattingQuality\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>007/13ER</xsd:documentation>\r\n				</xsd:annotation>\r\n				<xsd:simpleType>\r\n					<xsd:restriction base=\"xsd:string\">\r\n						<xsd:enumeration value=\"access\"/>\r\n						<xsd:enumeration value=\"preservation\"/>\r\n						<xsd:enumeration value=\"replacement\"/>\r\n					</xsd:restriction>\r\n				</xsd:simpleType>\r\n			</xsd:element>\r\n			<xsd:element name=\"internetMediaType\" type=\"xsd:string\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>856 $q</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"extent\" type=\"xsd:string\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>300 $a and $c, and 306 $a</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"digitalOrigin\">\r\n				<xsd:simpleType>\r\n					<xsd:restriction base=\"xsd:string\">\r\n						<xsd:enumeration value=\"born digital\"/>\r\n						<xsd:enumeration value=\"reformatted digital\">\r\n							<xsd:annotation>\r\n					<xsd:documentation>007ER code a</xsd:documentation>\r\n				</xsd:annotation>\r\n				</xsd:enumeration>\r\n						<xsd:enumeration value=\"digitized microfilm\">\r\n							<xsd:annotation>\r\n								<xsd:documentation>\r\n						007/11ER MARC code b\r\n						</xsd:documentation>\r\n							</xsd:annotation>\r\n						</xsd:enumeration>\r\n						<xsd:enumeration value=\"digitized other analog\">\r\n							<xsd:annotation>\r\n								<xsd:documentation>\r\n					007/11ER MARC code d\r\n						</xsd:documentation>\r\n							</xsd:annotation>\r\n						</xsd:enumeration>\r\n					</xsd:restriction>\r\n				</xsd:simpleType>\r\n			</xsd:element>\r\n			<xsd:element name=\"note\" type=\"noteType\"/>\r\n		</xsd:choice>\r\n		<xsd:attributeGroup ref=\"language\"/>\r\n	</xsd:complexType>\r\n	<!--   \r\n********** abstractType definition  **********              \r\n -->\r\n	<xsd:complexType name=\"abstractType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>520</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"unstructuredText\"/>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<!--   \r\n********** tableOfContentsType definition  **********              \r\n -->\r\n	<xsd:complexType name=\"tableOfContentsType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>505</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"unstructuredText\"/>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<!--   \r\n********** targetAudienceType definition  **********              \r\n -->\r\n	<xsd:complexType name=\"targetAudienceType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>008/22, 521</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:string\">\r\n				<xsd:attribute name=\"authority\" use=\"optional\"  type=\"xsd:string\">\r\n					<xsd:annotation>\r\n						<xsd:documentation>The value of this attribute is from the list at http://www.loc.gov/marc/sourcecode/target/targetsource.html. \r\n						If the value of this attribute is \"marctarget\", the content from the list at http://www.loc.gov/marc/sourcecode/target/targetlist.html\r\n</xsd:documentation>\r\n					</xsd:annotation>\r\n				</xsd:attribute>\r\n				<xsd:attributeGroup ref=\"language\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<!--   \r\n********** noteType definition  **********              \r\n -->\r\n	<xsd:complexType name=\"noteType\">\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"unstructuredText\">\r\n				<xsd:attribute name=\"ID\" type=\"xsd:ID\" use=\"optional\"/>\r\n				</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<!--  \r\n ********** subjectType definition  **********  	 	\r\n-->\r\n	<xsd:complexType name=\"subjectType\">\r\n		<xsd:choice minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n			<xsd:element name=\"topic\" type=\"xsd:string\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>650, 6xx $x</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"geographic\" type=\"xsd:string\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>651, 6xx $z</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"temporal\" type=\"dateType\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>648, 6xx $y</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"titleInfo\" type=\"titleInfoType\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>630</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"name\" type=\"nameType\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>600, 610, 611</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"geographicCode\">\r\n				<xsd:complexType>\r\n					<xsd:annotation>\r\n						<xsd:documentation> 043</xsd:documentation>\r\n					</xsd:annotation>\r\n					<xsd:simpleContent>\r\n						<xsd:extension base=\"xsd:string\">\r\n							<xsd:attribute name=\"authority\" type=\"placeAuthority\" use=\"optional\"/>\r\n						</xsd:extension>\r\n					</xsd:simpleContent>\r\n				</xsd:complexType>\r\n			</xsd:element>\r\n			<xsd:element name=\"hierarchicalGeographic\" type=\"hierarchicalGeographicType\"/>\r\n			<xsd:element name=\"cartographics\">\r\n				<xsd:complexType>\r\n					<xsd:annotation>\r\n						<xsd:documentation>255</xsd:documentation>\r\n					</xsd:annotation>\r\n					<xsd:sequence>\r\n						<xsd:element name=\"scale\" minOccurs=\"0\" type=\"xsd:string\"/>\r\n						<xsd:element name=\"projection\" minOccurs=\"0\" type=\"xsd:string\"/>\r\n						<xsd:element name=\"coordinates\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"xsd:string\"/>\r\n					</xsd:sequence>\r\n				</xsd:complexType>\r\n			</xsd:element>\r\n			<xsd:element name=\"occupation\" type=\"xsd:string\">\r\n				<xsd:annotation>\r\n					<xsd:documentation> 656 </xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"genre\" type=\"xsd:string\"/>\r\n		</xsd:choice>\r\n		<xsd:attribute name=\"ID\" type=\"xsd:ID\" use=\"optional\"/>\r\n		<xsd:attributeGroup ref=\"xlink:simpleLink\"/>\r\n		<xsd:attribute name=\"authority\" use=\"optional\"  type=\"xsd:string\">\r\n			<xsd:annotation>\r\n				<xsd:documentation>Value is from the list at  http:/www.loc.gov/marc/sourcecode/subject/subjectsource.html</xsd:documentation>\r\n			</xsd:annotation>\r\n		</xsd:attribute>\r\n		<xsd:attributeGroup ref=\"language\"/>\r\n	</xsd:complexType>\r\n	<!--   \r\n\r\n-->\r\n	<xsd:complexType name=\"hierarchicalGeographicType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>752</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:choice maxOccurs=\"unbounded\">\r\n			<xsd:element name=\"continent\" type=\"xsd:string\"/>\r\n			<xsd:element name=\"country\" type=\"xsd:string\"/>\r\n			<xsd:element name=\"province\" type=\"xsd:string\"/>\r\n			<xsd:element name=\"region\" type=\"xsd:string\"/>\r\n			<xsd:element name=\"state\" type=\"xsd:string\"/>\r\n			<xsd:element name=\"territory\" type=\"xsd:string\"/>\r\n			<xsd:element name=\"county\" type=\"xsd:string\"/>\r\n			<xsd:element name=\"city\" type=\"xsd:string\"/>\r\n			<xsd:element name=\"island\" type=\"xsd:string\"/>\r\n			<xsd:element name=\"area\" type=\"xsd:string\"/>\r\n		</xsd:choice>\r\n	</xsd:complexType>\r\n	<!--\r\n**********   classificationType definition **********  	 \r\n-->\r\n	<xsd:complexType name=\"classificationType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>050, 082, 080, 060, 086, 084</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:string\">\r\n				<xsd:attribute name=\"authority\" use=\"optional\" type=\"xsd:string\">\r\n					<xsd:annotation>\r\n						<xsd:documentation>Value of this attribute is from the list at  http:/www.loc.gov/marc/sourcecode/classification/classificationsource.html</xsd:documentation>\r\n					</xsd:annotation>\r\n				</xsd:attribute>\r\n				<xsd:attribute name=\"edition\" use=\"optional\"  type=\"xsd:string\">\r\n					<xsd:annotation>\r\n						<xsd:documentation>edition qualifies authority, for authorities that have editions, e.g. DDC.</xsd:documentation>\r\n					</xsd:annotation>\r\n				</xsd:attribute>\r\n				<xsd:attributeGroup ref=\"language\"/>\r\n				<xsd:attribute name=\"displayLabel\" use=\"optional\"  type=\"xsd:string\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<!-- \r\n**********   relatedItemType definition **********  \r\n-->\r\n	<xsd:complexType name=\"relatedItemType\">\r\n		<xsd:group ref=\"modsGroup\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n		<xsd:attribute name=\"type\" use=\"optional\">\r\n			<xsd:annotation>\r\n				<xsd:documentation>if 787; or 700, 710, 711, 730 with $t and ind2 = blank; then omit type.</xsd:documentation>\r\n			</xsd:annotation>\r\n			<xsd:simpleType>\r\n				<xsd:restriction base=\"xsd:string\">\r\n					<xsd:enumeration value=\"preceding\">\r\n						<xsd:annotation>\r\n							<xsd:documentation>780</xsd:documentation>\r\n						</xsd:annotation>\r\n					</xsd:enumeration>\r\n					<xsd:enumeration value=\"succeeding\">\r\n						<xsd:annotation>\r\n							<xsd:documentation>785</xsd:documentation>\r\n						</xsd:annotation>\r\n					</xsd:enumeration>\r\n					<xsd:enumeration value=\"original\">\r\n						<xsd:annotation>\r\n							<xsd:documentation>534, 786</xsd:documentation>\r\n						</xsd:annotation>\r\n					</xsd:enumeration>\r\n					<xsd:enumeration value=\"host\">\r\n						<xsd:annotation>\r\n							<xsd:documentation>772, 773</xsd:documentation>\r\n						</xsd:annotation>\r\n					</xsd:enumeration>\r\n					<xsd:enumeration value=\"constituent\">\r\n						<xsd:annotation>\r\n							<xsd:documentation>770, 774, 700, 710, 711 with $t and ind2 = 2</xsd:documentation>\r\n						</xsd:annotation>\r\n					</xsd:enumeration>\r\n					<xsd:enumeration value=\"series\">\r\n						<xsd:annotation>\r\n							<xsd:documentation>490, 440, 760, 800, 810, 811, 830</xsd:documentation>\r\n						</xsd:annotation>\r\n					</xsd:enumeration>\r\n					<xsd:enumeration value=\"otherVersion\">\r\n						<xsd:annotation>\r\n							<xsd:documentation>775</xsd:documentation>\r\n						</xsd:annotation>\r\n					</xsd:enumeration>\r\n					<xsd:enumeration value=\"otherFormat\">\r\n						<xsd:annotation>\r\n							<xsd:documentation>776</xsd:documentation>\r\n						</xsd:annotation>\r\n					</xsd:enumeration>\r\n					<xsd:enumeration value=\"isReferencedBy\">\r\n						<xsd:annotation>\r\n							<xsd:documentation>510</xsd:documentation>\r\n						</xsd:annotation>\r\n					</xsd:enumeration>\r\n				</xsd:restriction>\r\n			</xsd:simpleType>\r\n		</xsd:attribute>\r\n		<xsd:attribute name=\"displayLabel\" use=\"optional\" type=\"xsd:string\"/>\r\n		<xsd:attribute name=\"ID\" type=\"xsd:ID\" use=\"optional\"/>\r\n		<xsd:attributeGroup ref=\"xlink:simpleLink\"/>\r\n	</xsd:complexType>\r\n	<!--\r\n********** identifierType definition  **********  	                     	\r\n-->\r\n	<xsd:complexType name=\"identifierType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>010, 020, 022, 024, 028, 037, 856</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:string\">\r\n				<xsd:attribute name=\"type\" use=\"optional\">\r\n					<xsd:annotation>\r\n						<xsd:documentation>Suggested values include (but are not limited to):  \"hdl\",\"doi\",\"isbn\", \"isrc\",  \"ismn\" \"issn\", \"issue number\", \"istc\",  \"lccn\",  \"local\", \"matrix number\", \"music publisher\", \"music plate\", \"sici\", \"uri\", \"upc\", \"videorecording identifier\", \"stock number\"</xsd:documentation>\r\n					</xsd:annotation>\r\n				</xsd:attribute>\r\n				<xsd:attribute name=\"displayLabel\" use=\"optional\" type=\"xsd:string\">\r\n					<xsd:annotation>\r\n						<xsd:documentation>856$3</xsd:documentation>\r\n					</xsd:annotation>\r\n				</xsd:attribute>\r\n				<xsd:attribute name=\"invalid\" use=\"optional\">\r\n					<xsd:annotation>\r\n						<xsd:documentation>$z in 0XX fields</xsd:documentation>\r\n					</xsd:annotation>\r\n					<xsd:simpleType>\r\n						<xsd:restriction base=\"xsd:string\">\r\n							<xsd:enumeration value=\"yes\"/>\r\n						</xsd:restriction>\r\n					</xsd:simpleType>\r\n				</xsd:attribute>\r\n				<xsd:attributeGroup ref=\"language\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<!--  	 \r\n********** locationType definition  **********  	                     	\r\n-->\r\n	<xsd:complexType name=\"locationType\">\r\n		<xsd:sequence>\r\n			<xsd:element name=\"physicalLocation\" type=\"physicalLocationType\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element name=\"url\" type=\"urlType\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n		</xsd:sequence>\r\n	</xsd:complexType>\r\n	<!--  \r\n********** urlType definition  (subordinate to locationType) **********              \r\n -->\r\n	<xsd:complexType name=\"urlType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>856$u</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:anyURI\">\r\n				<xsd:attribute name=\"dateLastAccessed\" use=\"optional\"/>\r\n				<xsd:attribute name=\"displayLabel\" use=\"optional\" type=\"xsd:string\">\r\n					<xsd:annotation>\r\n						<xsd:documentation>856$3</xsd:documentation>\r\n					</xsd:annotation>\r\n				</xsd:attribute>\r\n				<xsd:attribute name=\"note\" use=\"optional\" type=\"xsd:string\">\r\n					<xsd:annotation>\r\n						<xsd:documentation>856$z</xsd:documentation>\r\n					</xsd:annotation>\r\n				</xsd:attribute>\r\n				<xsd:attribute name=\"access\" use=\"optional\">\r\n					<xsd:simpleType>\r\n						<xsd:restriction base=\"xsd:string\">\r\n							<xsd:enumeration value=\"preview\"/>\r\n							<xsd:enumeration value=\"raw object\"/>\r\n							<xsd:enumeration value=\"object in context\"/>\r\n						</xsd:restriction>\r\n					</xsd:simpleType>\r\n				</xsd:attribute>\r\n				<xsd:attribute name=\"usage\" use=\"optional\">\r\n					<xsd:simpleType>\r\n						<xsd:restriction base=\"xsd:string\">\r\n							<xsd:enumeration value=\"primary display\"/>\r\n													</xsd:restriction>\r\n					</xsd:simpleType>\r\n				</xsd:attribute>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<!--  \r\n  \r\n********** physicalLocationType definition  (subordinate to locationType) **********              \r\n -->\r\n	<xsd:complexType name=\"physicalLocationType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>852 $a $b $j $e</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"sourceType\">\r\n				<xsd:attribute name=\"type\" use=\"optional\" type=\"xsd:string\"/>\r\n				<xsd:attribute name=\"displayLabel\" use=\"optional\" type=\"xsd:string\">\r\n					<xsd:annotation>\r\n						<xsd:documentation>852$3</xsd:documentation>\r\n					</xsd:annotation>\r\n				</xsd:attribute>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<!--\r\n********** accessConditionType definition  **********              \r\n -->\r\n	<xsd:complexType name=\"accessConditionType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>506, 540</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"unstructuredText\"/>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<!-- \r\n********** partType definition **********  \r\n-->\r\n	<xsd:complexType name=\"partType\">\r\n		<xsd:choice minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n			<!--minOccurs=\"0\" allows <part> to be optionally empty,   when the ID and type attribute values contain all the information needed about the part. -->\r\n			<xsd:element name=\"detail\" type=\"detailType\"/>\r\n			<xsd:element name=\"extent\" type=\"extentType\"/>\r\n			<xsd:element name=\"date\" type=\"baseDateType\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>Use only if different from date of resource being described in \'originInfo\'</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"text\" type=\"unstructuredText\"/>\r\n		</xsd:choice>\r\n		<xsd:attribute name=\"ID\" type=\"xsd:ID\" use=\"optional\"/>\r\n		<xsd:attribute name=\"type\" type=\"xsd:string\" use=\"optional\"/>\r\n		<xsd:attribute name=\"order\" type=\"xsd:integer\" use=\"optional\"/>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"detailType\">\r\n		<xsd:choice maxOccurs=\"unbounded\">\r\n			<xsd:element name=\"number\" type=\"xsd:string\"/>\r\n			<xsd:element name=\"caption\" type=\"xsd:string\"/>\r\n			<xsd:element name=\"title\" type=\"xsd:string\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>Use only if different than main title of resource being described</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n		</xsd:choice>\r\n		<xsd:attribute name=\"type\" use=\"optional\" type=\"xsd:string\">\r\n			<xsd:annotation>\r\n				<xsd:documentation>Suggested values: part, volume, issue, chapter, section, paragraph, track. These values are used regardless of linguistic term)</xsd:documentation>\r\n			</xsd:annotation>\r\n		</xsd:attribute>\r\n		<xsd:attribute name=\"level\" type=\"xsd:positiveInteger\" use=\"optional\">\r\n			<xsd:annotation>\r\n				<xsd:documentation>Hierarchical level (level of enumeration) of a given detail element when there are multiple detail elements;  top level is 1. For example assume two details, volume and  issue; for volume (which is at a higher level hierarchically):  type=\"volume\" level=\"1\"; for issue:  type=\"issue\" level=\"2\".\r\n</xsd:documentation>\r\n			</xsd:annotation>\r\n		</xsd:attribute>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"extentType\">\r\n		<xsd:sequence>\r\n			<xsd:annotation>\r\n				<xsd:documentation> If \'start\' but not \'end\'  is supplied, it should be assumed that the end page is unknown. A single page is indicated by presence of both \'start\' and \'end\' with same value. </xsd:documentation>\r\n			</xsd:annotation>\r\n			<xsd:element name=\"start\" minOccurs=\"0\" type=\"xsd:string\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>  Use for first page or begin minute</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"end\" minOccurs=\"0\" type=\"xsd:string\">\r\n				<xsd:annotation>\r\n					<xsd:documentation> Use for last page, end minutes, or (together with start element) single page</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"total\" type=\"xsd:positiveInteger\" minOccurs=\"0\">\r\n				<xsd:annotation>\r\n					<xsd:documentation> A cardinal rather than ordinal number. Use for a total number of pages or minutes. \r\n</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"list\" minOccurs=\"0\" type=\"xsd:string\">\r\n				<xsd:annotation>\r\n					<xsd:documentation> Use for an unparsed statement, e.g. p. 5-12. </xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n		</xsd:sequence>\r\n		<xsd:attribute name=\"unit\"  type=\"xsd:string\">\r\n			<xsd:annotation>\r\n				<xsd:documentation>  suggested values: pages, minutes</xsd:documentation>\r\n			</xsd:annotation>\r\n		</xsd:attribute>\r\n		\r\n	</xsd:complexType>\r\n	<!-- \r\n\r\n********** extensionType definition **********  \r\n-->\r\n	<xsd:complexType name=\"extensionType\" mixed=\"true\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>use for local extensions or for extensions from other XML schemas</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:sequence>\r\n			<xsd:any processContents=\"lax\" maxOccurs=\"unbounded\"/>\r\n		</xsd:sequence>\r\n	</xsd:complexType>\r\n	<!--  \r\n**********  recordInfoType definition **********   \r\n-->\r\n	<xsd:complexType name=\"recordInfoType\">\r\n		<xsd:choice maxOccurs=\"unbounded\">\r\n			<xsd:element name=\"recordContentSource\" type=\"sourceType\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>040 $a, $d</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"recordCreationDate\" type=\"dateType\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>008/00-05</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"recordChangeDate\" type=\"dateType\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>005</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"recordIdentifier\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>001</xsd:documentation>\r\n				</xsd:annotation>\r\n				<xsd:complexType>\r\n					<xsd:simpleContent>\r\n						<xsd:extension base=\"xsd:string\">\r\n							<xsd:attribute name=\"source\" use=\"optional\" type=\"xsd:string\">\r\n								<xsd:annotation>\r\n									<xsd:documentation>Who supplied the identifier. From 003</xsd:documentation>\r\n								</xsd:annotation>\r\n							</xsd:attribute>\r\n						</xsd:extension>\r\n					</xsd:simpleContent>\r\n				</xsd:complexType>\r\n			</xsd:element>\r\n			<xsd:element name=\"languageOfCataloging\" type=\"languageType\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>040$b</xsd:documentation>\r\n				</xsd:annotation>\r\n				<!-- This applies to the record at large. Any top level element can indicate a language, which overides this value for that element. -->\r\n			</xsd:element>\r\n			<xsd:element name=\"recordOrigin\" type=\"xsd:string\"/>\r\n		</xsd:choice>\r\n		<xsd:attributeGroup ref=\"language\"/>\r\n		<!-- This applies to the language of RecordInfo only. I.e. for recordContentSource and for source of identifier. -->\r\n	</xsd:complexType>\r\n	<!--  \r\n***** End  data type definitions for top level elements.  \r\n\r\n***** Begin global definitions. \r\n-->\r\n	<!--\r\n********** unstructuredText Definition  ********** \r\n-->\r\n	<xsd:complexType name=\"unstructuredText\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>If the link  is supplied it is in lieu of or in addition to the content.</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:string\">\r\n				<xsd:attributeGroup ref=\"xlink:simpleLink\"/>\r\n				<xsd:attributeGroup ref=\"language\"/>\r\n				<xsd:attribute name=\"displayLabel\" use=\"optional\" type=\"xsd:string\"/>\r\n				<xsd:attribute name=\"type\" type=\"xsd:string\" use=\"optional\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<!--  \r\n********** dateType definition  **********  \r\n-->\r\n	<xsd:complexType name=\"baseDateType\">\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:string\">\r\n				<xsd:attribute name=\"encoding\" use=\"optional\">\r\n					<xsd:annotation>\r\n						<xsd:documentation>if omitted, free text is assumed</xsd:documentation>\r\n					</xsd:annotation>\r\n					<xsd:simpleType>\r\n						<xsd:restriction base=\"xsd:string\">\r\n							<xsd:enumeration value=\"w3cdtf\"/>\r\n							<xsd:enumeration value=\"iso8601\"/>\r\n							<xsd:enumeration value=\"marc\"/>\r\n						</xsd:restriction>\r\n					</xsd:simpleType>\r\n				</xsd:attribute>\r\n				<xsd:attribute name=\"qualifier\" use=\"optional\">\r\n					<xsd:simpleType>\r\n						<xsd:restriction base=\"xsd:string\">\r\n							<xsd:enumeration value=\"approximate\"/>\r\n							<xsd:enumeration value=\"inferred\"/>\r\n							<xsd:enumeration value=\"questionable\"/>\r\n						</xsd:restriction>\r\n					</xsd:simpleType>\r\n				</xsd:attribute>\r\n				<xsd:attribute name=\"point\" use=\"optional\">\r\n					<xsd:simpleType>\r\n						<xsd:restriction base=\"xsd:string\">\r\n							<xsd:enumeration value=\"start\"/>\r\n							<xsd:enumeration value=\"end\"/>\r\n						</xsd:restriction>\r\n					</xsd:simpleType>\r\n				</xsd:attribute>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"dateType\">\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"baseDateType\">\r\n				<xsd:attribute name=\"keyDate\" use=\"optional\">\r\n					<xsd:simpleType>\r\n						<xsd:annotation>\r\n							<xsd:documentation>So that a particular date may be distinguished among several dates. Thus for example when sorting MODS records by date, a date with keyDate=\"yes\" would be the date to sort on. It should occur only for one date at most in a given record.</xsd:documentation>\r\n						</xsd:annotation>\r\n						<xsd:restriction base=\"xsd:string\">\r\n							<xsd:enumeration value=\"yes\"/>\r\n						</xsd:restriction>\r\n					</xsd:simpleType>\r\n				</xsd:attribute>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"dateOtherType\">\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"dateType\">\r\n				<xsd:attribute name=\"type\" use=\"optional\" type=\"xsd:string\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<!--  \r\n********** sourceType definition  **********  	                       	  \r\n-->\r\n	<xsd:complexType name=\"sourceType\">\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:string\">\r\n				<xsd:attribute name=\"authority\" use=\"optional\" type=\"xsd:string\">\r\n					<xsd:annotation>\r\n						<xsd:documentation>Value of this attribute is from list at: http://www.loc.gov/marc/sourcecode/organization/organizationsource.html.  If the value is \"marcorg\", see: http://www.loc.gov/marc/organizations</xsd:documentation>\r\n					</xsd:annotation>\r\n				</xsd:attribute>\r\n				<xsd:attributeGroup ref=\"language\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<!--  \r\n ********** language attribute group definition  **********  	                       	  \r\n-->\r\n	<xsd:attributeGroup name=\"language\">\r\n		<xsd:attribute name=\"lang\" use=\"optional\" type=\"xsd:string\">\r\n			<xsd:annotation>\r\n				<xsd:documentation>ISO 639-2b</xsd:documentation>\r\n			</xsd:annotation>\r\n		</xsd:attribute>\r\n		<xsd:attribute ref=\"xml:lang\" use=\"optional\"/>\r\n		<xsd:attribute name=\"script\" use=\"optional\" type=\"xsd:string\"/>\r\n		<xsd:attribute name=\"transliteration\" use=\"optional\" type=\"xsd:string\"/>\r\n	</xsd:attributeGroup>\r\n	<!--  \r\n   ********** definition of codeOrText type used by type attribute \r\n   for elements that distinguish code from text  **********  	                       	  \r\n -->\r\n	<xsd:simpleType name=\"codeOrText\">\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"code\"/>\r\n			<xsd:enumeration value=\"text\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n	<!--  \r\n    ********** definition of placeAuthority type used by authority attribute\r\n      for  placeType and geographic  **********  	                       	  \r\n -->\r\n	<xsd:simpleType name=\"placeAuthority\">\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"marcgac\"/>\r\n			<xsd:enumeration value=\"marccountry\"/>\r\n			<xsd:enumeration value=\"iso3166\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n	<!--  \r\n    ********** definition of nameTypeAttribute used by name attribute\r\n      \"type\"  **********  	                       	  \r\n -->\r\n	<xsd:simpleType name=\"nameTypeAttribute\">\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"personal\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>100, 700</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:enumeration>\r\n			<xsd:enumeration value=\"corporate\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>110, 710.</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:enumeration>\r\n			<xsd:enumeration value=\"conference\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>111, 711</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:enumeration>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n	<xsd:simpleType name=\"versionType\">\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"3.2\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n</xsd:schema>','mods','mods',''),
	(87,'ExtendedMODS','3.2 with extensions','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!-- edited with XML Spy v4.4 U (http://www.xmlspy.com) by Ray Denenberg  (Library of Congress) -->\n<xsd:schema xmlns:xlink=\"http://www.w3.org/1999/xlink\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\" \nxmlns:dudro=\"http://www.deakin.edu.au/dro/schema.xsd\"\nxmlns=\"http://www.loc.gov/mods/v3\" targetNamespace=\"http://www.loc.gov/mods/v3\" elementFormDefault=\"qualified\" attributeFormDefault=\"unqualified\">\n	<xsd:import namespace=\"http://www.w3.org/XML/1998/namespace\" schemaLocation=\"http://www.w3.org/2001/xml.xsd\"/>\n	<xsd:import namespace=\"http://www.w3.org/1999/xlink\" schemaLocation=\"http://www.loc.gov/standards/xlink.xsd\"/>\n	<!-- \n\nMODS 3.2\nJune 1, 2006	\n\n***************************  List of changes from 3.1:\n\n1. <location><url>\n1.1. Added attribute \"note\" to allow for notes associated with the link.  \n    Tentative plan for 4.0 is to make it an element instead of an attribute, \n    and  wrap <url> and <urlNote> together. Can\'t do that in 3.2 \n    because it would not be compatible with 3.1. \n1.2. Added attribute \"access\",  enumerated list with values:\npreview\nraw object\nobject in context\n1.3  Add attribute \'usage\' under <url> with one enumerated value: \"primary display\".\n\n2. <physicalDescription><digitalOrigin>\nAdded enumerated values: \ndigitized microfilm \ndigitized other analog \n\n3. <part>\n3.1. Added attributes ID, type, order \n3.2. <part> may now be empty (minOccurs 0 on choice)\n\n4. ID attribute added.\n4.1 to relatedItem\n4.2 to note.\n\n5. The following  elements have been globalized:\n5.1 <dateCaptured>  (under <originInfo>)  dateCapturedType defined\n5.2 <edition> (under <originInfo> editionType defined\n5.3 <physicalLocation> (under <location>) physicalLocationType defined\n\n6. Elements whose type had been assumed to be \"string\",\n    but had not been explicitly typed, are now typed. \n\n7.  Add  subelement <genre> under <subject>.\n\n8. The schema location reference for xlink is changed to \n    http://www.loc.gov/standards/xlink.xsd. \n   (It was previously http://www.loc.gov/standards/mods/xlink.xsd. \n   The schema now resides in both places so that earlier versions \n    will not be affected, but it is now intended that the new copy \n    be referenced, outside of the mods directory, \n   so that other projects, e.g. mets, may reference it.)\n\n\n********************** end list of changes from 3.1\n\n\n*****  An instance of this schema is \n\n (1) a single MODS record:  \n	 -->\n	<xsd:element name=\"mods\" type=\"modsType\"/>\n	<!--  \nor \n\n(2) a collection of MODS records:  -->\n	<xsd:element name=\"modsCollection\">\n		<xsd:complexType>\n			<xsd:sequence>\n				<xsd:element ref=\"mods\" maxOccurs=\"unbounded\"/>\n			</xsd:sequence>\n		</xsd:complexType>\n	</xsd:element>\n	<!--  \n\n*****  End of \"instance\" definition\n\n******* Group definition. Forms the basis of the mods \n     record definintion, and also relatedItem. \n   Difference is that mods requires at least one element \n   and relatedItem does not.\n\n-->\n	<xsd:group name=\"modsGroup\">\n		<xsd:choice>\n			<xsd:element name=\"titleInfo\" type=\"titleInfoType\"/>\n			<xsd:element name=\"name\" type=\"nameType\"/>\n			<xsd:element name=\"typeOfResource\" type=\"typeOfResourceType\"/>\n			<xsd:element name=\"genre\" type=\"genreType\"/>\n			<xsd:element name=\"originInfo\" type=\"originInfoType\"/>\n			<xsd:element name=\"language\" type=\"languageType\"/>\n			<xsd:element name=\"physicalDescription\" type=\"physicalDescriptionType\"/>\n			<xsd:element name=\"abstract\" type=\"abstractType\"/>\n			<xsd:element name=\"tableOfContents\" type=\"tableOfContentsType\"/>\n			<xsd:element name=\"targetAudience\" type=\"targetAudienceType\"/>\n			<xsd:element name=\"note\" type=\"noteType\"/>\n			<xsd:element name=\"subject\" type=\"subjectType\"/>\n			<xsd:element name=\"classification\" type=\"classificationType\"/>\n			<xsd:element name=\"relatedItem\" type=\"relatedItemType\"/>\n			<xsd:element name=\"identifier\" type=\"identifierType\"/>\n			<xsd:element name=\"location\" type=\"locationType\"/>\n			<xsd:element name=\"accessCondition\" type=\"accessConditionType\"/>\n			<xsd:element name=\"part\" type=\"partType\"/>\n			<xsd:element name=\"extension\" type=\"extensionType\"/>\n			<xsd:element name=\"recordInfo\" type=\"recordInfoType\"/>\n		</xsd:choice>\n	</xsd:group>\n	<!--\n*****  Definition of a single MODS record\n-->\n	<xsd:complexType name=\"modsType\">\n		<xsd:group ref=\"modsGroup\" maxOccurs=\"unbounded\"/>\n		<xsd:attribute name=\"ID\" type=\"xsd:ID\" use=\"optional\"/>\n		<xsd:attribute name=\"version\" type=\"versionType\"/>\n	</xsd:complexType>\n	<!--\n*****  End of definition of a MODS record.\n \n***** Data type definitions for top level elements follow\n\n ********** titleInfoType definition **********\n -->\n	<xsd:complexType name=\"titleInfoType\">\n		<xsd:complexContent>\n			<xsd:extension base=\"baseTitleInfoType\">\n				<xsd:attribute name=\"type\" use=\"optional\">\n					<xsd:simpleType>\n						<xsd:annotation>\n							<xsd:documentation>if this attribute is omitted, then title relates to 245$a  $b  $n  and $p</xsd:documentation>\n						</xsd:annotation>\n						<xsd:restriction base=\"xsd:string\">\n							<xsd:enumeration value=\"abbreviated\">\n								<xsd:annotation>\n									<xsd:documentation>210</xsd:documentation>\n								</xsd:annotation>\n							</xsd:enumeration>\n							<xsd:enumeration value=\"translated\">\n								<xsd:annotation>\n									<xsd:documentation>242</xsd:documentation>\n								</xsd:annotation>\n							</xsd:enumeration>\n							<xsd:enumeration value=\"alternative\">\n								<xsd:annotation>\n									<xsd:documentation>246</xsd:documentation>\n								</xsd:annotation>\n							</xsd:enumeration>\n							<xsd:enumeration value=\"uniform\">\n								<xsd:annotation>\n									<xsd:documentation>240, 130</xsd:documentation>\n								</xsd:annotation>\n							</xsd:enumeration>\n						</xsd:restriction>\n					</xsd:simpleType>\n				</xsd:attribute>\n			</xsd:extension>\n		</xsd:complexContent>\n	</xsd:complexType>\n	<xsd:complexType name=\"baseTitleInfoType\">\n		<xsd:choice minOccurs=\"0\" maxOccurs=\"unbounded\">\n			<xsd:element name=\"title\" type=\"xsd:string\"/>\n			<xsd:element name=\"subTitle\" type=\"xsd:string\"/>\n			<xsd:element name=\"partNumber\" type=\"xsd:string\"/>\n			<xsd:element name=\"partName\" type=\"xsd:string\"/>\n			<xsd:element name=\"nonSort\" type=\"xsd:string\">\n				<xsd:annotation>\n					<xsd:documentation>All characters, including space, up to the first sort character.</xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n		</xsd:choice>\n		<xsd:attribute name=\"ID\" type=\"xsd:ID\" use=\"optional\"/>\n		<xsd:attributeGroup ref=\"xlink:simpleLink\"/>\n		<xsd:attributeGroup ref=\"language\"/>\n		<xsd:attribute name=\"authority\" type=\"xsd:string\" use=\"optional\"/>\n		<xsd:attribute name=\"displayLabel\" use=\"optional\" type=\"xsd:string\"/>\n	</xsd:complexType>\n	<!-- \n **********  nameType definition  **********   		\n-->\n	<xsd:complexType name=\"nameType\">\n		<xsd:choice minOccurs=\"0\" maxOccurs=\"unbounded\">\n			<xsd:element name=\"namePart\" type=\"namePartType\"/>\n			<xsd:element name=\"displayForm\">\n				<xsd:annotation>\n					<xsd:documentation>245$c</xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n			<xsd:element name=\"affiliation\" type=\"xsd:string\">\n				<xsd:annotation>\n					<xsd:documentation>100, 700 $u</xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n			<xsd:element name=\"role\" type=\"roleType\"/>\n			<xsd:element name=\"description\" type=\"xsd:string\"/>\n		</xsd:choice>\n		<xsd:attribute name=\"ID\" type=\"xsd:ID\" use=\"optional\"/>\n		<xsd:attribute name=\"type\" type=\"nameTypeAttribute\" use=\"optional\"/>\n		<xsd:attribute name=\"authority\" use=\"optional\" type=\"xsd:string\">\n			<xsd:annotation>\n				<xsd:documentation>Value is from the list at  \n				http:/www.loc.gov/marc/sourcecode/authorityfile/authorityfilesource.html\n				</xsd:documentation>\n			</xsd:annotation>\n		</xsd:attribute>\n		<xsd:attributeGroup ref=\"xlink:simpleLink\"/>\n		<xsd:attributeGroup ref=\"language\"/>\n		<!--\n***** End declaration of elements for nameType.  \n\n***** Begin declaration of attributes for nameType.\n-->\n	</xsd:complexType>\n	<!--  \n***** Begin definition of subordinate types for nameType.\n-->\n	<xsd:complexType name=\"namePartType\">\n		<xsd:simpleContent>\n			<xsd:extension base=\"xsd:string\">\n				<xsd:attribute name=\"type\" use=\"optional\">\n					<xsd:simpleType>\n						<xsd:restriction base=\"xsd:string\">\n							<xsd:enumeration value=\"date\"/>\n							<xsd:enumeration value=\"family\"/>\n							<xsd:enumeration value=\"given\"/>\n							<xsd:enumeration value=\"termsOfAddress\"/>\n						</xsd:restriction>\n					</xsd:simpleType>\n				</xsd:attribute>\n			</xsd:extension>\n		</xsd:simpleContent>\n	</xsd:complexType>\n	<xsd:complexType name=\"roleType\">\n		<xsd:sequence maxOccurs=\"unbounded\">\n			<xsd:element name=\"roleTerm\">\n				<xsd:complexType>\n					<xsd:annotation>\n						<xsd:documentation>if it is a code: 100, 110, 111, 700, 710, 711 $4.\n					If it is text:100, 110, 700, 710 $e.		\n					</xsd:documentation>\n					</xsd:annotation>\n					<xsd:simpleContent>\n						<xsd:extension base=\"xsd:string\">\n							<xsd:attribute name=\"authority\" use=\"optional\" type=\"xsd:string\">\n								<xsd:annotation>\n									<xsd:documentation>The value of this attribute is from list at http://www.loc.gov/marc/sourcecode/relator/relatorsource.html.  If the value is \"marcrelator\" the content is from list at http://www.loc.gov/marc/sourcecode/relator/relatorlist.html\n </xsd:documentation>\n								</xsd:annotation>\n							</xsd:attribute>\n							<xsd:attribute name=\"type\" type=\"codeOrText\" use=\"optional\"/>\n						</xsd:extension>\n					</xsd:simpleContent>\n				</xsd:complexType>\n			</xsd:element>\n		</xsd:sequence>\n	</xsd:complexType>\n	<!--\n***** End definition of nameType.\n-->\n	<!--\n********** typeOfResourceType  definition **********   	  \n -->\n	<xsd:complexType name=\"typeOfResourceType\">\n		<xsd:annotation>\n			<xsd:documentation>LDR/6</xsd:documentation>\n		</xsd:annotation>\n		<xsd:simpleContent>\n			<xsd:extension base=\"resourceType\">\n				<xsd:attribute name=\"collection\" use=\"optional\">\n					<xsd:simpleType>\n						<xsd:restriction base=\"xsd:string\">\n							<xsd:enumeration value=\"yes\"/>\n						</xsd:restriction>\n					</xsd:simpleType>\n				</xsd:attribute>\n				<xsd:attribute name=\"manuscript\" use=\"optional\">\n					<xsd:simpleType>\n						<xsd:restriction base=\"xsd:string\">\n							<xsd:enumeration value=\"yes\"/>\n						</xsd:restriction>\n					</xsd:simpleType>\n				</xsd:attribute>\n			</xsd:extension>\n		</xsd:simpleContent>\n	</xsd:complexType>\n	<xsd:simpleType name=\"resourceType\">\n		<xsd:restriction base=\"xsd:string\">\n			<xsd:enumeration value=\"text\"/>\n			<xsd:enumeration value=\"cartographic\"/>\n			<xsd:enumeration value=\"notated music\"/>\n			<xsd:enumeration value=\"sound recording-musical\"/>\n			<xsd:enumeration value=\"sound recording-nonmusical\"/>\n			<xsd:enumeration value=\"sound recording\">\n				<xsd:annotation>\n					<xsd:documentation>Use for mixed musical and nonmusical, or when not specified whether musical or nonmusical.\n</xsd:documentation>\n				</xsd:annotation>\n			</xsd:enumeration>\n			<xsd:enumeration value=\"still image\"/>\n			<xsd:enumeration value=\"moving image\"/>\n			<xsd:enumeration value=\"three dimensional object\"/>\n			<xsd:enumeration value=\"software, multimedia\"/>\n			<xsd:enumeration value=\"mixed material\"/>\n		</xsd:restriction>\n	</xsd:simpleType>\n	<!--  \n********** genreType defintion  **********  	\n-->\n	<xsd:complexType name=\"genreType\">\n		<xsd:annotation>\n			<